  calculateResponsiveDimensions, 
  getConsistentPadding, 
  getConsistentFontSizes 
} from '../../constants';

/**
 * Factory for creating chart configurations with consistent sizing
 * Uses unified sizing logic for all chart types
 */
export const createChartConfig = (type, isExpanded, containerWidth = 400) => {
  // Get consistent dimensions and styling
  const { width, height } = calculateResponsiveDimensions(containerWidth, isExpanded);
  const padding = getConsistentPadding(isExpanded);
  const fontSizes = getConsistentFontSizes(isExpanded);
  
  // Base configuration that all charts share
  const baseConfig = {
    width,
    height,
    padding,
    fontSize: fontSizes,
    expanded: isExpanded,
    containerWidth
  };

  switch (type) {
    case 'glucose':
      return {
        ...baseConfig,
        // Glucose-specific settings - DRAMATICALLY reduced zoom, prevent cutoff
        dayWidth: isExpanded ? 35 : 30,  // DRAMATICALLY reduced from 50/40 to 35/30
        yAxisLabels: [0, 4, 8, 12],
        yAxisRange: 12,
        barWidth: isExpanded ? 6 : 5,    // DRAMATICALLY reduced from 8/6 to 6/5
        // Custom padding for glucose chart - Much more space, prevent cutoff
        padding: {
          top: isExpanded ? 70 : 55,     // DRAMATICALLY reduced dashboard from 65 to 55
          right: isExpanded ? 60 : 30,   // DRAMATICALLY increased from 50 to 60 for right margin
          bottom: isExpanded ? 70 : 55,  // DRAMATICALLY reduced dashboard from 65 to 55
          left: isExpanded ? 60 : 40     // DRAMATICALLY reduced dashboard from 45 to 40
        }
      };

    case 'bloodPressure':
      return {
        ...baseConfig,
        // Blood pressure-specific settings - DRAMATICALLY better padding and font sizing
        yAxisRange: { systolic: 200, diastolic: 120 },
        yAxisOffset: { systolic: 0, diastolic: 0 },
        yAxisLabels: {
          systolic: isExpanded ? [0, 40, 80, 120, 160, 200] : [0, 100, 200],
          diastolic: isExpanded ? [0, 20, 40, 60, 80, 100, 120] : [0, 60, 120],
        },
        dayWidth: (width - padding.left - padding.right) / 7,
        barWidth: isExpanded ? 14 : 8, // Increased from 12/6
        dayPadding: isExpanded ? 10 : 6, // Increased from 8/4
        // Custom padding for blood pressure chart - Much more space for larger fonts and x-axis labels
        padding: {
          top: isExpanded ? 70 : 35,    // DRAMATICALLY increased expanded from 60 to 70 for much larger fonts
          right: isExpanded ? 40 : 15,  // DRAMATICALLY increased expanded from 35 to 40
          bottom: isExpanded ? 120 : 80, // DRAMATICALLY increased expanded from 100/50 to 120/80 for x-axis labels
          left: isExpanded ? 100 : 50    // DRAMATICALLY increased expanded from 90/60 to 100/50
        }
      };

    case 'exercise':
      return {
        ...baseConfig,
        // Exercise-specific settings - DRAMATICALLY less zoomed in, prevent cutoff
        dayWidth: isExpanded ? 45 : 35,  // DRAMATICALLY reduced from 60/40 to 45/35
        barWidth: isExpanded ? 15 : 12,  // DRAMATICALLY reduced from 20/18 to 15/12
        // Custom padding for exercise chart - Much more space for labels, prevent cutoff
        padding: {
          top: isExpanded ? 45 : 30,    // DRAMATICALLY reduced dashboard from 35 to 30
          right: isExpanded ? 50 : 20,  // DRAMATICALLY increased from 40 to 50 for right margin
          bottom: isExpanded ? 100 : 80, // DRAMATICALLY increased from 90/70 to 100/80
          left: isExpanded ? 80 : 60    // DRAMATICALLY increased from 70/55 to 80/60
        }
      };

    case 'mealContents':
      // Calculate meal-specific dimensions - DRAMATICALLY better dashboard fit
      const mealHeight = isExpanded ? 90 : 50; // DRAMATICALLY reduced dashboard height from 60 to 50
      const totalMealHeight = 4 * mealHeight;
      const mealDayWidth = (width - padding.left - padding.right) / 7;
      
      return {
        ...baseConfig,
        height: totalMealHeight + padding.top + padding.bottom,
        // Meal-specific settings
        mealHeight,
        dayWidth: mealDayWidth,
        totalMealHeight,
        // Custom padding for meal chart - Much more space for x-axis, much better dashboard fit
        padding: {
          top: isExpanded ? 45 : 30,    // DRAMATICALLY reduced dashboard top padding from 35 to 30
          right: isExpanded ? 45 : 30,  // DRAMATICALLY increased dashboard right padding from 25 to 30
          bottom: isExpanded ? 120 : 95, // DRAMATICALLY increased bottom padding from 110/85 to 120/95
          left: isExpanded ? 160 : 130  // DRAMATICALLY increased dashboard left padding from 120 to 130
        }
      };

    case 'sleep':
      return {
        ...baseConfig,
        // Sleep-specific settings
        dayWidth: (width - padding.left - padding.right) / 7,
        barWidth: isExpanded ? 14 : 8, // Increased from 12/6
        // Custom padding for sleep chart
        padding: {
          top: isExpanded ? 50 : 40,
          right: isExpanded ? 30 : 20,
          bottom: isExpanded ? 80 : 60,
          left: isExpanded ? 60 : 50
        }
      };

    case 'pain':
      return {
        ...baseConfig,
        // Pain-specific settings - DRAMATICALLY better dashboard fit, larger SVG
        bodySvgWidth: isExpanded ? 120 : 80,  // DRAMATICALLY reduced dashboard from 90 to 80 for much better fit
        bodySvgHeight: isExpanded ? 240 : 160, // DRAMATICALLY reduced dashboard from 180 to 160 for much better fit
        // Custom padding for pain chart - Much better text fitting in dashboard
        padding: {
          top: isExpanded ? 35 : 20,    // DRAMATICALLY reduced dashboard from 25 to 20
          right: isExpanded ? 25 : 10,  // DRAMATICALLY reduced dashboard from 15 to 10
          bottom: isExpanded ? 55 : 30, // DRAMATICALLY reduced dashboard from 35 to 30
          left: isExpanded ? 35 : 20    // DRAMATICALLY reduced dashboard from 25 to 20
        }
      };

    case 'mood':
      return {
        ...baseConfig,
        // Mood-specific settings - Better spacing
        dayWidth: (width - padding.left - padding.right) / 7,
        cellSize: isExpanded ? 50 : 35, // Increased from 40/30
        // Custom padding for mood chart
        padding: {
          top: isExpanded ? 60 : 50,    // Increased for header
          right: isExpanded ? 40 : 30,  // Increased for right margin
          bottom: isExpanded ? 60 : 50, // Increased for bottom margin
          left: isExpanded ? 60 : 50    // Increased for left margin
        }
      };

    default:
      return baseConfig;
  }
};
